import Login from "./Pages/Login/Login";
import Profile from "./Pages/Profile/Profile";
import Register from "./Pages/Register/Register";



function App() {



  return (
    <BrowserRouter>

    <Routes>
      <Route path="/home" element={<Home />}/>
      <Route path="timeline" element={<Profile />} />
    </Routes>

    </BrowserRouter>

);

}

export default App;
